import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
import Alert from "./Alert";
import Spinner from "./Spinner";

const Products = () => {
  const navigate = useNavigate();
  const [products, setProducts] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [alertType, setAlertType] = useState(null);
  const [alertMessage, setAlertMessage] = useState("");

  // Fetch products data
  useEffect(() => {
    const fetchProducts = async () => {
      try {
        const response = await axios.get("/products");

        if (response.status === 200) {
          if (response.data.length === 0) {
            setAlertType("warning");
            setAlertMessage("No products found.");
          } else {
            setProducts(response.data);
          }
        } else {
          setAlertType("danger");
          setAlertMessage(
            `Failed to retrieve products: ${response.status} ${response.statusText}`
          );
        }
      } catch (error) {
        setAlertType("danger");
        setAlertMessage(`Failed to retrieve products: ${error.message}`);
      } finally {
        setIsLoading(false);
      }
    };

    fetchProducts();
  }, []);

  // Navigate to edit product page
  const handleEditProduct = (product) => {
    const editProductUrl = `edit?id=${product._id}`;
    navigate(editProductUrl);
  };

  return (
    <div className="container mt-5">
      {alertMessage && <Alert type={alertType} message={alertMessage} />}
      {isLoading ? (
        <Spinner />
      ) : (
        <div className="card shadow-lg border-0">
          {/* Card Header */}
          <div className="card-header bg-gradient-primary text-white">
            <h3 className="text-center mb-0">Manage Products</h3>
          </div>

          {/* Card Body */}
          <div className="card-body">
            {/* Add Product Button */}
            <div className="d-flex justify-content-between align-items-center mb-3">
              <h5 className="mb-0">Product List</h5>
              <Link to="add" className="btn btn-success">
                <i className="fa fa-plus"></i> Add Product
              </Link>
            </div>

            {/* Accordion for Table */}
            <div className="accordion" id="productsAccordion">
              <div className="accordion-item">
                <h2 className="accordion-header" id="productTableHeading">
                  <button
                    className="accordion-button"
                    type="button"
                    data-bs-toggle="collapse"
                    data-bs-target="#productTable"
                    aria-expanded="true"
                    aria-controls="productTable"
                  >
                    Product Information
                  </button>
                </h2>

                <div
                  id="productTable"
                  className="accordion-collapse collapse show"
                  aria-labelledby="productTableHeading"
                >
                  <div className="accordion-body p-0">
                    <div className="table-responsive">
                      <table className="table table-striped table-hover mb-0">
                        <thead className="table-primary">
                          <tr>
                            <th>Name</th>
                            <th>Core Company</th>
                            <th>Rate</th>
                            <th>Status</th>
                            <th>Tax Exempted</th>
                            <th>Actions</th>
                          </tr>
                        </thead>
                        <tbody>
                          {products.map((product) => (
                            <tr key={product._id}>
                              <td>{product.name}</td>
                              <td>{product.coreCompany}</td>
                              <td>${parseFloat(product.rate).toFixed(2)}</td>
                              <td>
                                {product.status === "active" ? (
                                  <span className="badge bg-success">Active</span>
                                ) : (
                                  <span className="badge bg-danger">Inactive</span>
                                )}
                              </td>
                              <td>
                                {product.taxExempted ? (
                                  <span className="badge bg-warning">Yes</span>
                                ) : (
                                  <span className="badge bg-secondary">No</span>
                                )}
                              </td>
                              <td>
                                <button
                                  className="btn btn-sm btn-outline-primary me-2"
                                  onClick={() => handleEditProduct(product)}
                                >
                                  <i className="fa fa-edit"></i> Edit
                                </button>
                                <button
                                  className="btn btn-sm btn-outline-danger"
                                  onClick={() => alert("Delete function coming soon!")}
                                >
                                  <i className="fa fa-trash"></i> Delete
                                </button>
                              </td>
                            </tr>
                          ))}
                        </tbody>
                      </table>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default Products;
